import React from 'react'
import './home.css'

const Home = ({ user }) => {
  console.log(user);
  return (
    <div className="background">
      {(user === 'undefined')? (
        <div className="home">
          <h1>Welcome {user.displayName}</h1>
          <img src={user.profileImage} alt="" />
        </div>
      ) : (
        <div className="home">
          <h1>Welcome</h1>
          <p>Please login to continue</p>
        </div>
      )}
    </div>
  )
}

export default Home
